        <strong>Nitrogen Source</strong><br />
        <p>Crimson clover is a nutrient scavenger and a nitrogen producer. A crop of crimson clover will produce up to 125lbs of N and 5000lbs of dry matter.
        </p>
        <strong>Weed Suppression</strong><br />
        <p>Crimson clover's fast fall growth and aggressive growth habit make it an excellent weed suppressor.</p>
